@Component({
  selector: 'app-deities',
  templateUrl: './deities.component.html',
  styleUrls: ['./deities.component.css']
})
export class DeitiesComponent {
  deities = [
    { name: 'Athena', description: 'Goddess of wisdom and warfare.' },
    { name: 'Thor', description: 'Norse god of thunder.' },
    // Add more deities 
  ];
}
